        kata_kunci = ["stroke", "jantung", "sesak", "pendarahan", "kecelakaan", "tidak sadar", "kejang", "ginjal", "kanker"]
        is_kritis = any(k in keluhan.lower() for k in kata_kunci)

        skor = 1 if is_kritis else 2
